      subroutine twh_ffmmff94_bond(lfailure,ffname,nbondtypes)
c     ******************************************************************
c     * sets up the MMFF94 bond potentials                             *
c     *                                                                *
c     * originally written 12-09-2006 by M.G. Martin                   *
c     * last modified 07-15-2014 by M.G. Martin                        *
c     ******************************************************************
      implicit none
c     --- variables passed to/from the subroutine
      character*(FFNAMELEN) ffname
      logical lfailure
      integer nbondtypes
c     --- local variables
c     --- integer scalars
      integer type,isame
c     --- character string scalars
      character*(FFNAMELEN) order
c     --- character string arrays
      character*(FFNAMELEN) vnlocal
      dimension vnlocal(MAXSAMEV,MAXVNAME) 
c     --- double precision scalars
      double precision force,cs
c     --- double precision arrays
      double precision vclocal
      dimension vclocal(MINVIBCOEFF:MAXVIBCOEFF)

c     --- initialize type count
      type = 0

      type = type + 1
      call twh_vibstyle(GLB_SET,type,BOND_STYLE_COMPASS)
      vclocal(0) = 1.508d0
      force = CON_KCALTOK*143.9825d0*0.5d0* 4.258d0
      cs = -2.0d0
      vclocal(1) = force
      vclocal(2) = force*cs
      vclocal(3) = force*(cs**2)*7.0d0/12.0d0
      call twh_set_vibcoeffs(type,vclocal)
      call twh_vibff(GLB_SET,type,ffname)
      isame = 0
c     --- origin: C94  
      isame = isame + 1
      vnlocal(isame,1) = ' 1'
      vnlocal(isame,2) = ' 1'
      order = 'wild'
      call twh_viborder(GLB_SET,type,order)
      call twh_set_vibnames(type,isame,vnlocal)

      type = type + 1
      call twh_vibstyle(GLB_SET,type,BOND_STYLE_COMPASS)
      vclocal(0) = 1.482d0
      force = CON_KCALTOK*143.9825d0*0.5d0* 4.539d0
      cs = -2.0d0
      vclocal(1) = force
      vclocal(2) = force*cs
      vclocal(3) = force*(cs**2)*7.0d0/12.0d0
      call twh_set_vibcoeffs(type,vclocal)
      call twh_vibff(GLB_SET,type,ffname)
      isame = 0
c     --- origin: C94  
      isame = isame + 1
      vnlocal(isame,1) = ' 1'
