      subroutine twh_ffmmff94_angle(lfailure,ffname,nangletypes)
c     ******************************************************************
c     * sets up the MMFF94 angle terms                                 *
c     *                                                                *
c     * originally written 12-11-2006 by M.G. Martin                   *
c     * last modified 07-21-2014 by M.G. Martin                        *
c     ******************************************************************
      implicit none
c     --- variables passed to/from the subroutine
      character*(FFNAMELEN) ffname
      logical lfailure
      integer nangletypes
c     --- local variables
c     --- character string scalars
      character*15 orderang
c     --- character string arrays
      character*(FFNAMELEN) bnlocal 
      dimension bnlocal(MAXSAMEB,MAXBNAME)
c     --- integer scalars
      integer type,style
c     --- double precision scalars
      double precision cb,radtodegsq,onepi,force,radtodeg
c     --- double precisino arrays
      double precision bclocal
      dimension bclocal(MINBENDCOEFF:MAXBENDCOEFF)

c     --- there are two angle types for this forcefield
c     --- the first, and most common, is a combination of a cubic
c     --- term with some bond-stretch terms

c     --- the second is used for angles with a linear geometry 
c     --- (those with an equilibrium angle of 180).  It does not have
c     --- any bond-stretch terms and uses a relatively simple cosine

c     --- set some useful constants
      cb = -0.4d0
c     --- retrieve constant
      call twh_constant_pi(GLB_GET,onepi)
      call twh_constant_radtodeg(GLB_GET,radtodeg)
      radtodegsq = radtodeg**2

c     --- initialize type count
      type = 0

      type = type + 1
      style = ANG_STYLE_MMFF
      call twh_anglestyle(GLB_SET,type,style)
c     --- origin:0:*-1-* MMFF94 DEF  
      bclocal(0) = 108.900d0
      force = ( 0.000d0)*0.043844d0*0.5d0*(CON_KCALTOK)*radtodegsq
      bclocal(1) = force
      bclocal(2) = force*cb
      call twh_lbonang(GLB_SET,type,.false.)
      call twh_set_bencoeff(type,bclocal)
      orderang = 'MMFF sb:** a:0 '
      call twh_angleorder(GLB_SET,type,orderang)
      call twh_bendff(GLB_SET,type,ffname)
