      subroutine twh_ffmmff94_dihedral(lfailure,ffname,ndihedtypes)
c     ******************************************************************
c     * sets up the MMFF94 dihedral parameters                         *
c     *                                                                *
c     * originally written 12-13-2006 by M.G. Martin                   *
c     * last modified 08-04-2011 by M.G. Martin                        *
c     ******************************************************************
      implicit none
c     --- variables passed to/from the subroutine
      character*(*) ffname
      logical lfailure
      integer ndihedtypes
c     --- local variables
      integer type
      character*15 ordertor
      character*(FFNAMELEN) tnlocal
      dimension tnlocal(MAXSAMET,MAXTNAME)
      double precision tclocal
      dimension tclocal(MINTORCOEFF:MAXTORCOEFF)
      double precision onepi

      call twh_constant_pi(GLB_GET,onepi)

c     --- initialize type count
      type = 0

      type = type + 1
      call twh_torstyle(GLB_SET,type,2)
      call twh_loftor(GLB_SET,type,.true.)
      tclocal(-1) = 0.75d0
      tclocal(1) = ( 0.000d0)*(0.5d0)*(CON_KCALTOK)
      tclocal(2) = ( 0.000d0)*(0.5d0)*(CON_KCALTOK)
      tclocal(3) = ( 0.300d0)*(0.5d0)*(CON_KCALTOK)
      call twh_set_torcoeff(type,tclocal)
